import React from 'react';
import {useSelector} from 'react-redux';
const Nav = () => {
    const token = useSelector((state)=>{return state.token});
  return (

    <nav>
      <ul>
        <li><a href="/">Home</a></li>
        {token === null ? (
          <>
            <li><a href="/login">Login</a></li>
            <li><a href="/register">Register</a></li>
          </>
        ) : (
          <li><a href="/profile">Profile</a></li>
        )}
      </ul>
    </nav>
  );
};

export default Nav;
